INSERT INTO `protocol` VALUES ('1', '鼎芯Box注册协议', '<p>					</p><p><br></p><p><br></p><p style=\"white-space: normal;\"><br></p><h1 style=\"white-space: normal;\">珠海鼎芯科技协议&nbsp;V1.0&nbsp;</h1><p style=\"white-space: normal;\">在您使用珠海鼎芯APP服务之前，请您务必仔细阅读本协议所有条款，您的使用行为将被视为对本协议条款全部内容的认可。本协议适用于所有的珠海鼎芯APP服务，包括但不限于当前所使用的各项服务及后续服务的升级和更新。</p><p style=\"white-space: normal;\">一、服务内容及使用须知</p><p style=\"white-space: normal;\">服务内容：珠海鼎芯的服务人群为老年人，为老年人提供居家养老服务。主要包括：对老年人请求服务的信息进行实时动态关注并及时进行提示；老年人或亲属可以通过珠海鼎芯终端，发起相关的服务请求，实现各项生活便利功能。</p><p style=\"white-space: normal;\">使用须知：珠海鼎芯由老年人及亲属进行注册下载，老年人及亲属可以通过珠海鼎芯终端，发起相关的服务请求，在惠老商城根据实际需要，购买生活用品、保健品、休闲康乐等商品，也可以进行信息查询、视频通话、健康诊疗、服务下单、服务状态跟踪、电子围栏、服务评价等。</p><p style=\"white-space: normal;\">二、隐私保护</p><p style=\"white-space: normal;\">1、为了进一步完善您使用珠海鼎芯APP服务，以便我们提供更好的服务，我们也需要在为您提供服务的过程中收集必要的数据等相关信息，以改进我们的服务。在您注册该APP的同时，我们视为您对此已充分知晓并同意我们对该些数据等信息的收集及合理、合法使用。</p><p style=\"white-space: normal;\"><br></p><p style=\"white-space: normal;\">三、免责声明</p><p style=\"white-space: normal;\">1、在&amp;ldquo;首页&amp;rdquo;中的服务项目，系第三方专业的服务机构提供，海予公司仅为服务双方提供交易洽谈通道，第三方在提供服务的过程当中，若发生意外事件（含涉及到生命财产安全的），海予公司对因此造成的损失不负相关的连带责任，但海予公司有义务提供相关的交易、洽谈、服务等信息，协助事件的处理。</p><p style=\"white-space: normal;\">2、因孝心商城的部分商品系第三方提供，海予公司仅为买卖双方提供交易平台，第三方所提供的商品存在任何问题均与海予公司无关；</p><p style=\"white-space: normal;\">3、在&amp;ldquo;监护&amp;rdquo;应用中，亲友可以及时的浏览长辈们的心率、位置、血压等检测数据。在日常生活当中，如果长辈们没能正常佩戴、使用相关的监护设备（如智能手表、血压仪等），那么，将无法及时、正常的浏览相关数据信息，海予公司对因此造成的事件或损失不负相关的连带责任；</p><p style=\"white-space: normal;\">4、海予公司需要定期或不定期地对提供网络服务的平台或相关的设备进行检修或者维护，如因此类情况而造成网络服务在合理时间内的中断，海予公司无需为此承担任何责任，但海予公司应尽可能事先进行通告。</p><p style=\"white-space: normal;\">5、海予公司可因服务需要变更本服务或屏蔽、删除其部分功能。</p><p style=\"white-space: normal;\">6、基于以下原因而造成的利润、商业信誉、资料损失或其他有形或无形损失，海予公司不承担任何直接、间接的赔偿：</p><p style=\"white-space: normal;\">　　（1） 对珠海鼎芯APP服务的使用或无法使用；</p><p style=\"white-space: normal;\">　　（2）您、老年人的资料遭到未授权的使用或修改及其他与珠海鼎芯APP服务相关的事宜。</p><p style=\"white-space: normal;\">7、服务期间因一切远程传输行为可能遭致的数据丢失、内容侵权及其造成的影响和损失，海予公司对其概不负责，亦不承担任何法律责任。</p><p style=\"white-space: normal;\">四、所有权</p><p style=\"white-space: normal;\">&nbsp; &nbsp; 海予公司对珠海鼎芯APP服务及所有元素，包括但不限于所有内容、数据、技术、软件、代码、界面以及与其相关的所有衍生内容享有全部的所有权。</p><p style=\"white-space: normal;\">五、其他</p><p style=\"white-space: normal;\">1、在法律法规允许的范围内，本协议最终解释权归海予公司所有。</p><p style=\"white-space: normal;\">2、本协议在您下载珠海鼎芯APP后即生效，海予公司有权对本协议内容进行修改。您使用珠海鼎芯APP服务，则视为您接受海予公司对本协议相关条款所做的修改。</p><p style=\"white-space: normal;\">3、本协议的订立、执行和解释及争议的解决均应适用中国法律。如双方就本协议内容或其执行发生任何争议，双方应尽量友好协商解决；协商不成时，任何一方均可向海予公司所在地人民法院提起诉讼。</p><p style=\"white-space: normal;\">4、如本协议中的任何条款无论因何种原因完全或部分无效或不具有执行力，本协议的其余条款仍应有效并且有约束力。</p><p style=\"white-space: normal;\">珠海鼎芯科技&nbsp;版权所有</p><p style=\"white-space: normal;\">珠海鼎芯科技有限公司：&nbsp;<a href=\"http://www.hvit.com.cn/\">http://www.d-chip.com.cn</a></p><p style=\"white-space: normal;\">客服热线：0756-*******</p><p style=\"white-space: normal;\">&nbsp;<img src=\"http://localhost:80/expbox/upload/ueditor/1499605949751.jpg\" title=\"android-智慧社区.png\" _src=\"http://localhost:80/expbox/upload/ueditor/1499605949751.jpg\" alt=\"android-智慧社区.png\"></p><p style=\"white-space: normal;\"><br></p><p><br></p><p><br></p><p><br></p><p>			</p>', '2017-07-09 21:12:35');
